import React from 'react';

const Contact = () => {
    return (
        <section style={styles.container}>
            <h2 style={styles.title}>Контакты</h2>
            <p style={styles.text}>Мы всегда на связи, пишите или звоните!</p>
            <div style={styles.contactInfo}>
                <div style={styles.contactItem}>
                    <strong style={styles.label}>Телефон:</strong>
                    <p style={styles.text}>+7 (123) 456-78-90</p>
                </div>
                <div style={styles.contactItem}>
                    <strong style={styles.label}>Email:</strong>
                    <p style={styles.text}>support@company.com</p>
                </div>
                <div style={styles.contactItem}>
                    <strong style={styles.label}>Адрес:</strong>
                    <p style={styles.text}>Москва, ул. Примерная, 123</p>
                </div>
            </div>
        </section>
    );
};

const styles = {
    container: {
        padding: '40px 20px',
        backgroundColor: '#f4f4f4',
        textAlign: 'center',
    },
    title: {
        fontSize: '32px',
        fontWeight: 'bold',
        marginBottom: '20px',
    },
    text: {
        fontSize: '18px',
        color: '#333',
        marginBottom: '10px',
    },
    contactInfo: {
        display: 'flex',
        justifyContent: 'center',
        gap: '30px',
        flexWrap: 'wrap',
    },
    contactItem: {
        flex: '1 1 200px',
    },
    label: {
        fontWeight: 'bold',
        fontSize: '16px',
    },
};

export default Contact;
